import React from 'react';
import Login from './Login';
import { Route, Routes, BrowserRouter } from 'react-router-dom';

function Home() {
    return (
            <BrowserRouter>
            <nav>
                <a href="/Login">Login</a> | 
            </nav>
            <Route path="/Login" element={<Login />} />
            </BrowserRouter>
    );
}
export default Home;
